import React from 'react';
import '../styles/Home.css';

class Home extends React.Component {
  render() {
    return (
      <div className="home-container">
        <h1>Welcome to Techbitz</h1>
        <p>At Techbitz, we specialize in offering premium technology solutions. Whether you need a new website, app development, digital context and ads, or robust testing frameworks, our team of experts can help. We pride ourselves on our dedication to quality and our commitment to customer satisfaction.</p>
      </div>
    );
  }
}

export default Home;
